import logo from './logo.svg';
import './App.css';
import Main from './main';
import BasicPage from './Pages/BasicPage.js';
import { BrowserRouter,Router,Routes } from 'react-router-dom';
function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Router path="/" element={<BasicPage/>}></Router>
      </Routes>
    </BrowserRouter>
  );
}

export default App;
